import React from 'react';
import './Menu.css';

const Menu = () => {
  return (
    <div className="menu">
      <ul className="menu-tree">
        <li className="menu-item">
          <h1>Home</h1>
          <ul>
            <li>Subheading 1.1</li>
            <li>Subheading 1.2</li>
          </ul>
        </li>
        <li className="menu-item">
          <h1>Heading 2</h1>
          <ul>
            <li>Subheading 2.1</li>
            <li>Subheading 2.2</li>
          </ul>
        </li>
      </ul>
    </div>
  );
};

export default Menu;
